const leadersToSingings = whoSangWithWhom['leader_to_singings'];
const allLeaders = Object.keys(leadersToSingings);
const singings = whoSangWithWhom['index_to_singing'];

function safeIndex(list, item) {
  const index = list.indexOf(item);
  return index === -1 ? -1 : index;
}

function sharedSingings(leaders) {

  // now we have a list of leaders, and we want to find all the singings they have in common
  let indexes = new Set(leadersToSingings[leaders[0]]);
  for (let i = 1; i < leaders.length; i++) {
    // get the set intersection of the indexes
    indexes = new Set([...indexes].filter((index) => leadersToSingings[leaders[i]].includes(index)));
  }

  // now we have a set of indexes, and we want to print out the information for each one
  if (indexes.size === 0) {
    return { singers: leaders, singings: [] };
  }
  const sharedSingings = Array.from(indexes).map((index) => singings[index]);

  // each singing is separated by a tab. split
  const sharedSingingsArray = sharedSingings.map((singing) => singing.split('\t'));
  // the last element is the date, so sort by that
  sharedSingingsArray.sort((a, b) => new Date(a.slice(-1)[0]) - new Date(b.slice(-1)[0]));
  // make each shared singing an object
  const sharedSingingsObj = sharedSingingsArray.map((singing) => ({ singing: singing[0], location: singing[1], date: singing[3] }));
  return { singers: leaders, singings: sharedSingingsObj };
}
function getSharedSingings() {
  const singer1 = document.getElementById('singer1').value.trim();
  const singer2 = document.getElementById('singer2').value.trim();
  const singer3 = document.getElementById('singer3').value.trim();
  const leaders = [singer1, singer2, singer3].filter((leader) => leader.trim() !== '');


  const { singers, singings, error } = sharedSingings(leaders);

  const resultsDiv = document.getElementById('results');
  resultsDiv.innerHTML = '';

  if (error) {
    resultsDiv.innerHTML = `<p>${error}</p>`;
    return;
  }
  if (leaders.length === 0) {
    resultsDiv.innerHTML = `<p>Enter at least one singer, please.</p>`;
    return;
  }
  if (singings.length === 0) {
    resultsDiv.innerHTML = `<p>No shared singings found for ${singers.join(', ')}.</p>`;
    return;
  }

  const table = document.createElement('table');
  table.innerHTML = `
    <thead>
      <tr>
        <th>Singing</th>
        <th>Location</th>
        <th>Date</th>
      </tr>
    </thead>
    <tbody>
      ${singings.map((singing) => `
        <tr>
          <td>${singing.singing}</td>
          <td>${singing.location}</td>
          <td>${singing.date}</td>
        </tr>
      `).join('')}
    </tbody>
  `;
  resultsDiv.appendChild(table);
};
